function ElectricityConsumptionProfile( building, constants ) {
	var profile = new Profile();
	var distributionProfile = new Profile();
	var hour;
	var yearlyConsumption;
	for(hour=0;hour<8760;hour++) {
		profile.profile[hour] = 0.0;
	}
	if((building.buildingType == "1" && building.electricityConsumptionEstimated == true) || building.buildingType == "2") {
		distributionProfile = ElectricityConsumptionDistributionProfile(building,constants);
		yearlyConsumption = building.nominalElectricityConsumption * building.floorArea;
		for(hour=0;hour<8760;hour++) {
			profile.profile[hour] = yearlyConsumption * distributionProfile.profile[hour];
		}
	}
	return profile;
}

function ElectricityConsumptionDistributionProfile( building, constants ) {
	var weekValue;
	var season;
	var dayType;
	var day;
	var hourOfDay;
	var hourOfYear;
	var sum;
	var profile = new Profile();
	hourOfYear=0;
	sum=0.0;
	for (day=0;day<365;day++) {	
		weekValue = constants.domesticElectricityConsumptionWeekValues [ constants.referenceYearCalendar.week[day] - 1 ];
		dayType = constants.referenceYearCalendar.dayType[day] - 1;
		if( constants.referenceYearCalendar.month[day] == 12 || constants.referenceYearCalendar.month[day] == 1 || constants.referenceYearCalendar.month[day] == 2 ) {
			season = 1;
		} else {
			season = 0;
		}
		for (hourOfDay=0;hourOfDay<24;hourOfDay++) {
			profile.profile[hourOfYear] = weekValue * domesticElectricityConsumptionHourValues[season][dayType][hourOfDay]
			sum+=profile.profile[hourOfYear];
			hourOfYear++;
		}
	}
	for(hourOfYear=0;hourOfYear<8760;hourOfYear++) {
		profile.profile[hourOfYear]/=sum;
	}
	return profile;
}
function HotWaterHeatingEnergyProfile(building,constants) {	
	var profile = new Profile();
	var hour;
	for(hour=0;hour<8760;hour++) {
		profile.profile[hour] = 0.0;
	}
	if(building.buildingType == "1" || building.buildingType == "2") {
		for(hour=0;hour<8760;hour++) {
			profile.profile[hour] = (constants.waterThermalCapacity * building.waterHeatingTemperatureDifference / constants.kWhInkJ) * (constants.waterDensity * building.waterConsumptionPerPersonPerDay / 24) * building.numberOfInhabitants / building.waterHeatingLosses;
		}
	}
	return profile;
}
function Profile() {
	
	this.profile = new Array();


	this.year = year;
	function year() {
		var hour;
		var sum = 0.0;
		for (hour=0; hour<8760; hour++) {
			sum += this.profile[hour];
		}
		return sum;
	}


	this.day = day;
	function day(day) {
		var hour;
		var sum = 0.0;
		for(hour=24*(day-1);hour<(24*day);hour++) {
			sum += this.profile[hour];
		}
		return sum;
	}


	this.month = month;
	function month(month) {
		var hour = 0;
		var sum = 0.0;
		var dayFrom = 1;
		var dayTo;
		var monthIndex;
		var dayIndex;
		var daysInMonth = [31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31];
		for(monthIndex=0;monthIndex<(month-1);monthIndex++) {
			dayFrom += daysInMonth[monthIndex]
		}
		dayTo = dayFrom + daysInMonth[month-1];
		for(dayIndex=dayFrom;dayIndex<dayTo;dayIndex++) {
			sum += this.day(dayIndex);
		}
		return sum;
	}


	this.hour = hour;
	function hour(hour) {
		return this.profile[hour];		
	}


	this.period = period;
	function period(periodStartYear, periodStartMonth, periodEndYear, periodEndMonth) {
		var year = periodStartYear;
		var month = periodStartMonth;
		var sum = 0.0;
		while( +year <= +periodEndYear && ( (+year < +periodEndYear) || (+month <= +periodEndMonth) ) ) {
			sum += this.month(month);
			month++;
			if( month > 12 ) {
				month = 1;
				year++;
			}
		}
		return sum;
	}

	this.hourOfDayAvgValueInMonth = hourOfDayAvgValueInMonth;
	function hourOfDayAvgValueInMonth(hourOfDay,month,constants) {
		var monthIndex;
		var dayFrom = 0;
		var dayTo;
		var dayIndex;
		var hourOfYear = 0;
		var sum = 0.0;
		var n = 0;
		for(monthIndex=0;monthIndex<(month-1);monthIndex++) {
			dayFrom += constants.daysInMonth[monthIndex]
		}
		dayTo = dayFrom + constants.daysInMonth[month-1];
		hourOfYear = dayFrom * 24;
		for(dayIndex=dayFrom;dayIndex<dayTo;dayIndex++) {
			sum += this.profile[hourOfYear+hourOfDay-1];
			n++;
			hourOfYear+=24;
		}
		return sum/n;
	}

	this.hourOfDayMaxValueInMonth = hourOfDayMaxValueInMonth;
	function hourOfDayMaxValueInMonth(hourOfDay,month,constants) {
		var monthIndex;
		var dayFrom = 0;
		var dayTo;
		var dayIndex;
		var hourOfYear = 0;
		var max;
		var n = 0;
		for(monthIndex=0;monthIndex<(month-1);monthIndex++) {
			dayFrom += constants.daysInMonth[monthIndex]
		}
		dayTo = dayFrom + constants.daysInMonth[month-1];
		hourOfYear = dayFrom * 24;
		max = this.profile[hourOfYear+hourOfDay-1];
		for(dayIndex=dayFrom;dayIndex<dayTo;dayIndex++) {
			if(this.profile[hourOfYear+hourOfDay-1] > max) {
				max = this.profile[hourOfYear+hourOfDay-1];
			}
			hourOfYear+=24;
		}
		return max;
	}

	this.hourOfDayMinValueInMonth = hourOfDayMinValueInMonth;
	function hourOfDayMinValueInMonth(hourOfDay,month,constants) {
		var monthIndex;
		var dayFrom = 0;
		var dayTo;
		var dayIndex;
		var hourOfYear = 0;
		var min;
		var n = 0;
		for(monthIndex=0;monthIndex<(month-1);monthIndex++) {
			dayFrom += constants.daysInMonth[monthIndex]
		}
		dayTo = dayFrom + constants.daysInMonth[month-1];
		hourOfYear = dayFrom * 24;
		min = this.profile[hourOfYear+hourOfDay-1];
		for(dayIndex=dayFrom;dayIndex<dayTo;dayIndex++) {
			if(this.profile[hourOfYear+hourOfDay-1] < min) {
				min = this.profile[hourOfYear+hourOfDay-1];
			}
			hourOfYear+=24;
		}
		return min;
	}

	this.yearPositive = yearPositive;
	function yearPositive() {
		var hour;
		var sum = 0.0;
		for (hour=0; hour<8760; hour++) {
			if(this.profile[hour] > 0) {
				sum += this.profile[hour];
			}
		}
		return sum;
	}

	this.yearNegative = yearNegative;
	function yearNegative() {
		var hour;
		var sum = 0.0;
		for (hour=0; hour<8760; hour++) {
			if(this.profile[hour] < 0) {
				sum += this.profile[hour];
			}
		}
		return Math.abs(sum);
	}

	this.yearMin = yearMin;
	function yearMin() {
		var hour;
		var min =this.profile[0];
		for (hour=1; hour<8760; hour++) {
			if(this.profile[hour] < min) {
				min = this.profile[hour];
			}
		}
		return min;
	}

	this.yearMax = yearMax;
	function yearMax() {
		var hour;
		var max =this.profile[0];
		for (hour=1; hour<8760; hour++) {
			if(this.profile[hour] > max) {
				max = this.profile[hour];
			}
		}
		return max;
	}
}

function SolarElectricityProductionProfile( solarInstallation, constants ) {
	var profile = new Profile();
	var hour;
	var electricityProductionTotal;
	electricityProductionTotal = InstallationAreaAvgIrradiance(solarInstallation,constants) * solarInstallation.photovoltaicArea * solarInstallation.photovoltaicPeakPowerFactor * solarInstallation.photovoltaicInstallationFactor;
		for(hour=0;hour<8760;hour++) {
			profile.profile[hour] = electricityProductionTotal * constants.vantaaReferenceYearTotalIrradiationOnHorizontalSurface[hour];
		}
	return profile;
}

function InstallationAreaAvgIrradiance(solarInstallation,constants) {
	var installationAreaAvgIrradiance;
	var installationAreaOnGoodRoof;
	var installationAreaOnRemainingRoof;
	var installationAreaTotal = solarInstallation.photovoltaicArea + solarInstallation.thermalArea;
	if(installationAreaTotal > solarInstallation.roofArea) {
		installationAreaTotal = solarInstallation.roofArea;
	}
	if(installationAreaTotal <= solarInstallation.roofGoodArea) {
		installationAreaOnGoodRoof = installationAreaTotal;
		installationAreaOnRemainingRoof = 0;
	} else {
		installationAreaOnGoodRoof = solarInstallation.roofGoodArea;
		installationAreaOnRemainingRoof = installationAreaTotal - installationAreaOnGoodRoof;
	}
	if (installationAreaTotal > 0 ) {
		installationAreaAvgIrradiance = ((installationAreaOnGoodRoof * solarInstallation.roofGoodAreaAvgIrradiance + installationAreaOnRemainingRoof * solarInstallation.roofRemainingAreaAvgIrradiance) / installationAreaTotal);
	} else {
		installationAreaAvgIrradiance = 0;
	}
	return installationAreaAvgIrradiance;
}
function SolarHeatingEnergyProductionProfile(solarInstallation, constants) {
	var profile = new Profile();
	var day;
	var month;
	var hourOfYear = 0;
	var hourOfDay;
	var irradianceProfile = SolarIrradianceProfile(solarInstallation, constants);
	var arrayOfMonths = SolarHeatEnergyProductionArrayOfMonths(solarInstallation,constants);
	var irradianceInMonth;
	for(month=1;month<=12;month++) {
		irradianceInMonth = irradianceProfile.month(month);
		for(day=0;day<constants.daysInMonth[month-1];day++) {
			for(hourOfDay=0;hourOfDay<24;hourOfDay++) {
				if(irradianceInMonth > 0) {
					profile.profile[hourOfYear] = (arrayOfMonths[month-1] * irradianceProfile.profile[hourOfYear]) / irradianceInMonth;
				} else {
					profile.profile[hourOfYear] = 0;
				}
				hourOfYear++;
			}
		}
	}
	return profile;
}

function SolarHeatEnergyProductionArrayOfMonths(solarInstallation, constants) {
	var month;
	var energyProduction = new Array();
	var reservoirVolume  = solarInstallation.reservoirVolumeDimensioning * solarInstallation.thermalArea;
	var hotWaterInMonth;
	var energyDemand;
	for(month=1;month<=12;month++) {
		hotWaterInMonth = constants.daysInMonth[month-1] * reservoirVolume / solarInstallation.reservoirCapacityDimensioning;
		energyDemand = (constants.waterThermalCapacity * solarInstallation.waterHeatingTemperatureDifference / constants.kWhInkJ) * (constants.waterDensity * hotWaterInMonth) / solarInstallation.waterHeatingLosses;
		energyProduction[month-1] = SolarHeatingEnergyProductionInMonth(solarInstallation, constants, month, energyDemand, reservoirVolume);	
	}
	return energyProduction;
}

function SolarHeatingEnergyProductionInMonth(solarInstallation, constants, month, energyDemand, reservoirVolume) {
	var A 			= Number(solarInstallation.thermalArea);
	var IAM 		= Number(solarInstallation.IAM);
	var a1 			= Number(solarInstallation.a1);
	var a2 			= Number(solarInstallation.a2);	
	var nkierto 	= Number(solarInstallation.nkierto);	
	var no 			= Number(solarInstallation.no);	
	var thw 		= Number(solarInstallation.thw);	
	var tcw 		= Number(solarInstallation.tcw);	
	var Vnim 		= reservoirVolume;	
	var Vll 		= Number(solarInstallation.Vll);	
	var xfactor 	= Number(solarInstallation.xfactor);	

	var a 			=  1.029;
	var b 			= -0.065;
	var c 			= -0.245;
	var d 			=  0.0018;
	var e 			=  0.0215;
	var f 			=  0;
	var ctyyppi 	=  1;
	var Vref 		=  75 * A;

	var th;
	var Uc;
	var Ul;
	var dT;
	var te;
	var tref;
	var ccap;
	var Vtod;
	var fapu;
	var X;
	var Y;

	var Qtarve = energyDemand;
	var Qkerain;
	var Qtuotto;

	// keräimen saama aurinkosäteily tarkastelukuukautena
	Qkerain = SolarIrradianceProfile(solarInstallation,constants).month(month);

	// tarkastelukuukauden pituus tunteina
	th = constants.daysInMonth[month-1]*24;

	// tarkastelukuukauden keskimääräinen ulkolämpötila
	var vantaaReferenceYearOutsideTemperature = new Profile();
	vantaaReferenceYearOutsideTemperature.profile = constants.vantaaReferenceYearOutsideTemperature;
	te = vantaaReferenceYearOutsideTemperature.month(month) / th;

	// keräinpiirin putkiston lämpöhäviökerroin
	Ul = 5 + 0.5*A;

	// keräinpiirin lämpöhäviökerroin
	Uc = a1 + 40*a2 + Ul/A;

	// sovelluksesta ja varastotyypistä riippuva vertailulämpötila
	tref = 11.6 + 1.180*thw + 3.86*tcw - 1.32*te

	// referenssilämpötilaero
	dT = tref - te;

	// varaajan tilavuuden korjaus
	fapu = xfactor * Vll/Vnim;
	Vtod = Vnim*(1-fapu);

	// varaajakapasiteetin korjauskerroin
	ccap = Math.pow(Vtod/Vref, -0.25);

	// häviöt-tarve -suhde
	X = (A*Uc*nkierto*dT*th*ccap)/(Qtarve*1000);

	// tuotto-tarve -suhde
	Y = (A*IAM*no*nkierto*Qkerain)/Qtarve;

	// järjestelmän energiantuotto
	Qtuotto = ctyyppi * ( a*Y + b*X + c*Math.pow(Y,2) + d*Math.pow(X,2) + e*Math.pow(Y,3) + f*Math.pow(X,3) ) * Qtarve;
	if(Qtuotto<0) {
		Qtuotto = 0.0;
	}

	var debugEl = document.getElementById("debug");
	if (debugEl) {
		debugEl.innerHTML += "<br>Qtarve: " + Qtarve;
		debugEl.innerHTML += "<br>kuukausi: " + month;	
		debugEl.innerHTML += "<br>Qkerain: " + Qkerain;
		debugEl.innerHTML += "<br>th: " + th;
		debugEl.innerHTML += "<br>te: " + te;
		debugEl.innerHTML += "<br>Ul: " + Ul;
		debugEl.innerHTML += "<br>Uc: " + Uc;
		debugEl.innerHTML += "<br>tref: " + tref;
		debugEl.innerHTML += "<br>dT: " + dT;
		debugEl.innerHTML += "<br>Vtod: " + Vtod;
		debugEl.innerHTML += "<br>ccap: " + ccap;
		debugEl.innerHTML += "<br>X: " + X;
		debugEl.innerHTML += "<br>Y: " + Y;
		debugEl.innerHTML += "<br>Qtuotto: " + Qtuotto;
	//	debugEl.innerHTML += "<br>" + Qtarve + ";" + Qtuotto;
		debugEl.innerHTML += "<br>";
	}

	return Qtuotto;
} 

function SolarIrradianceProfile(solarInstallation, constants) {
	var hour;
	var profile = new Profile();
	var avgIrradiance = InstallationAreaAvgIrradiance(solarInstallation,constants);
	for(hour=0;hour<8760;hour++) {
			profile.profile[hour] = avgIrradiance * constants.vantaaReferenceYearTotalIrradiationOnHorizontalSurface[hour];
		}
	return profile;		
}








